const Header=()=>{
  return(
    <header>
      <h1>Task Tracker</h1>
    </header>
  )
}
import PropTypes from 'prop-types'
Header.defaultProps={
  title:'Task Tracker'
}

Header.PropTypes={
  title: PropTypes.string.isRequired,
}
export default Header
